import React, { useState, useEffect } from "react";
import { useLocation } from 'react-router-dom';
import { parseInput } from "./hexUtils";
import { decodeProto } from "./protobufDecoder";

function App() {
  const [response, setResponse] = useState(null);
  const location = useLocation();

  useEffect(() => {
    if (location.pathname !== '/') {
      const newHex = decodeURI(location.pathname.substr(1));
      const buffer = parseInput(newHex);
      const decodeResult = decodeProto(buffer);
      const firstValue = decodeResult.parts[0].value;
      setResponse({ value: firstValue });
    }
  }, [location.pathname]);

  return response ? (
    <div>{JSON.stringify(response)}</div>
  ) : null;
}

export default App;
